pullsbody:
New tests can be found here: https://github.com/mozilla/bedrock/blob/master/tests/functional/firefox/test_do_not_track.py.

These tests also checked the visibility of several additional elements, but I don't feel these check add much value. I'm leaving the link checking tests until we have a link checker running regularly.

@alexgibson r?

We have coverage of the sign up form in [these new bedrock tests](https://github.com/mozilla/bedrock/blob/d543a1783ba820828fd33e58f1771d354d1886da/tests/functional/test_home.py#L51-L77) so I'd like to remove the mostly duplicate checks from here.

The main difference is that we're checking the sign up form from the **home** page in bedrock, whereas we were testing it from the **about** page here. Other than that, we don't have a check for the privacy link in bedrock. This will ultimately be covered by a link checker, but if we feel we need a check for this in the meantime I can either leave a basic test here, or add one to bedrock that clicks the link and makes sure we get the expected page.

@alexgibson do you feel that our coverage in bedrock is good enough for us to remove these? Do we need to check the form from the **about** page? Do we need to maintain coverage for the privacy link?
